Anil Kumar Mukhopadhyaya, &quot;Value Engineering Mastermind: From Concept to Value Engineering Certification&quot;
Sage Publications Pvt. Ltd | 2009 | ISBN: 813210062X | 176 pages | PDF 

This jargon-free book demystifies all the concepts required for a well rounded understanding of the theory of Value Engineering (VE) and Value Engineering Certification Programs.

Value Engineering Mastermind: From Concept to Value Engineering Certification helps the readers to understand VE concepts, and practice VE concepts and acquire the Society of American Value Engineers (SAVE) International Certifications.
